import React, { Component } from 'react';
import loslagos_1 from './img/loslagos_1.png';
import loslagos_2 from './img/loslagos_2.png';
import Contacto from './Contacto'

const message = () => {
    <Contacto />
}


export default function Home(){
    state = {
        "img": loslagos_1,
        clicked: false,
    }

    handleClick = () => {
        this.setState({ clicked: !this.state.clicked })
    }

        return (
            <div class='/'>
                <h1>HOME </h1>
                <button onClick={message}> Press me to print a message! </button>

                <img
                    src={this.state.img}
                    onMouseEnter={() => {
                        this.setState({
                            "img": loslagos_2
                        })
                    }}

                    onMouseOut={() => {
                        this.setState({
                            "img": loslagos_1
                        })
                    }}
                />
            </div>
        )
}
